import React, { useState } from "react";
import "../../App.css";
import {
    Row,
    Col,
    Form,
  } from "react-bootstrap";
  import FloatingLabel from "react-bootstrap-floating-label";

export function AccountBox(props) {
    return(
    <Row className="w-100">
        <Col className="w-100">
        {/* <div className="boxContainer"> */}
            <div className="topContainer w-100">
                <div className="backDrop">
                </div>
            </div>

            <div className="headerContainer w-75">
                <div className="headerText">
                    Login
                </div>
                <p className="textForm"></p>
            </div>
        {/* </div> */}
        </Col>
        <>
            <FloatingLabel
                controlId="pseudoLogin"
                label="pseudo"
                className="mb-3 w-50"
            >
                <Form.Control type="pseudo" placeholder="TotoDu59" />
            </FloatingLabel>

            <FloatingLabel controlId="passwordLogin" label="password">
                <Form.Control type="password" placeholder="Mot de passe" />
            </FloatingLabel>
        </>
    </Row>
    )
}
